package myPro;
import java.util.*;
public class forloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner in = new Scanner(System.in);
		System.out.println("Enter Limits");
		int n=in.nextInt();
		for(int i=10;i<=n;i=i+10) {
			System.out.println(i);
		}

	}

}
